import React, { Component } from "react";
import "antd/dist/antd.css";
import styled from "styled-components";
import { Row, Col } from "antd";
import { FC } from "react";
import LeftSide from "./LeftSide";
import { Form, Input, Button } from "antd";
import imgURL from "../assets/img/kingdom-11.png";

// const SignIn: FC = () => {
class SignIn extends Component {
  clickHandler = () => {
    console.log("Button clicked");
  };

  render() {
    return (
      <>
        <Row>
          <Col span={6}>
            <LeftSide imgURL={imgURL} />
          </Col>
          <Col span={18}>
            <ContentBox>
              <TopLine>
                <Row justify="end">
                  <Col>
                    <Member>Not a member?</Member>
                    <SignInBtn href="/signup">Sign up</SignInBtn>
                  </Col>
                </Row>
              </TopLine>
              <SignUpBox>
                <FormContainer>
                  <Form
                    name="normal_login"
                    className="login-form"
                    initialValues={{
                      remember: true,
                    }}
                  >
                    <FormTitle>Sign in to Fly</FormTitle>
                    <Form.Item
                      label="Email"
                      labelCol={{ span: 24 }}
                      rules={[
                        {
                          required: true,
                          message: "Please input your Email!",
                        },
                      ]}
                    >
                      <Input type="email" style={{ padding: "8px 12px" }} />
                    </Form.Item>

                    <Form.Item
                      label="Password"
                      labelCol={{ span: 24 }}
                      rules={[
                        {
                          required: true,
                          message: "Please input your Password!",
                        },
                      ]}
                    >
                      <Input.Password
                        type="password"
                        style={{ padding: "8px 12px" }}
                      />
                      <a className="login-form-forgot" href="">
                        Forgot password?
                      </a>
                    </Form.Item>

                    <Form.Item>
                      <Button
                        style={{ width: "100%", height: "40px" }}
                        type="primary"
                        htmlType="submit"
                        className="login-form-button"
                        onClick={clickHandler}
                      >
                        Sign in
                      </Button>
                    </Form.Item>
                  </Form>
                </FormContainer>
              </SignUpBox>
            </ContentBox>
          </Col>
        </Row>
      </>
    );
  }
}

export default SignIn;

const ContentBox = styled.section`
  height: 100vh;
  background: #e8e8e8;
`;

const TopLine = styled.div`
  margin-right: 42px;
  padding-top: 48px;
`;

const SignUpBox = styled.div`
  height: 82vh;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Member = styled.p`
  display: inline;
  text-decoration: none;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
  color: #000000;
  padding-right: 16px;
`;

const SignInBtn = styled.a`
  text-decoration: none;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
`;

const FormContainer = styled.div`
  width: 420px;
`;

const FormTitle = styled.p`
  font-weight: 400;
  font-size: 24px;
  line-height: 32px;
  text-align: center;
`;
